import React from "react";
import logo from "../images/logo.png";

const Header = () => {
  return (
    <>
      <header className="App-header">
        <div className="header-div-logo">
          <img
            src={logo}
            alt="Official logo of Pokemon"
            className="header-logo"
          />
        </div>
      </header>
    </>
  );
};

export default Header;
